import * as React from 'react';
import { DataGrid } from '@mui/x-data-grid';
import CommonScript from "./CommonScript";

const columns = [
  { field: 'id', headerName: 'ID', width: 70 },
  { field: 'firstName', headerName: 'First name', width: 130 },
  { field: 'lastName', headerName: 'Last name', width: 130 },
  {
    field: 'age',
    headerName: 'Age',
    type: 'number',
    width: 90,
  },
  {
    field: 'fullName',
    headerName: 'Full name',
    description: 'This column has a value getter and is not sortable.',
    sortable: false,
    width: 160,
    valueGetter: (value, row) => `${row.firstName || ''} ${row.lastName || ''}`,
  },
];

const rows = [
  { BookId: 1, lastName: 'Snow', firstName: 'Jon', age: 35 },
  { BookId: 2, lastName: 'Lannister', firstName: 'Cersei', age: 42 },
  { BookId: 3, lastName: 'Lannister', firstName: 'Jaime', age: 45 },
  { BookId: 4, lastName: 'Stark', firstName: 'Arya', age: 16 },
  { BookId: 5, lastName: 'Targaryen', firstName: 'Daenerys', age: null },
  { BookId: 6, lastName: 'Melisandre', firstName: null, age: 150 },
  { BookId: 7, lastName: 'Clifford', firstName: 'Ferrara', age: 44 },
  { BookId: 8, lastName: 'Frances', firstName: 'Rossini', age: 36 },
  { BookId: 9, lastName: 'Roxie', firstName: 'Harvey', age: 65 },
];

export default function DataTable() {
  return (

    <div /*style={{ height: 400, width: '100%' }}*/ >
        <CommonScript />
      <DataGrid
        rows={rows}
        columns={columns}
        initialState={{
          pagination: {
            paginationModel: { page: 0, pageSize: 5 },
          },
        }}
        pageSizeOptions={[5, 10]}
        checkboxSelection
      />
    </div>
  );
}
